webpackJsonp([0x894e9ad54c19],{1058:function(e,a){e.exports={data:{markdownRemark:{html:'<p>Here\'s a collection of useful tools that you may reap productivity from.</p>\n<h3 id="last-pass"><a href="#last-pass" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Last Pass</h3>\n<p>Last Pass is a <strong>password manager</strong> that can help generate unique, complex, passwords for all of the services that you sign up to.\nIt also has great mobile support.</p>\n<h3 id="tamper-monkey"><a href="#tamper-monkey" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Tamper Monkey</h3>\n<p><a href="https://chrome.google.com/webstore/detail/tampermonkey/dhdgffkkebhmkfjojejmpbldmpobfkfo?hl=en">Tamper Monkey</a> is great for <strong>running custom scripts</strong> on arbitrary websites. You can use it to either change the user interface, or functionality of a website. For instance, I have used it as part of my development cycle to:</p>\n<ul>\n<li>Provide auto-completion for frequently filled out forms</li>\n<li>Log analytics requests, rather than send them</li>\n<li>User Interface tweaks, such as modifying or hiding functionality</li>\n</ul>\n<p>If you use Firefox, then you may find <a href="https://addons.mozilla.org/en-US/firefox/addon/greasemonkey/">Grease Monkey</a> useful.</p>\n<h3 id="lighthouse"><a href="#lighthouse" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Lighthouse</h3>\n<p>Lighthouse is great for <strong>measuring website quality</strong>. It generates reports highlighting issues with performance, accessibility, and SEO best practices.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/lighthouse-a6d2e757a58d7b6dc6b4516c188016a9-d0c91.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 47.036474164133736%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="lighthouse"\n        title="Example of generated reports using lighthouse"\n        src="/static/lighthouse-a6d2e757a58d7b6dc6b4516c188016a9-10273.png"\n        srcset="/static/lighthouse-a6d2e757a58d7b6dc6b4516c188016a9-9b14a.png 163w,\n/static/lighthouse-a6d2e757a58d7b6dc6b4516c188016a9-94962.png 325w,\n/static/lighthouse-a6d2e757a58d7b6dc6b4516c188016a9-10273.png 650w,\n/static/lighthouse-a6d2e757a58d7b6dc6b4516c188016a9-2fc6f.png 975w,\n/static/lighthouse-a6d2e757a58d7b6dc6b4516c188016a9-a8a2c.png 1300w,\n/static/lighthouse-a6d2e757a58d7b6dc6b4516c188016a9-173d2.png 1950w,\n/static/lighthouse-a6d2e757a58d7b6dc6b4516c188016a9-d0c91.png 2632w"\n        sizes="(max-width: 650px) 100vw, 650px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3 id="react-developer-tools"><a href="#react-developer-tools" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>React Developer Tools</h3>\n<p>The React developer tools are great for viewing the React element hierarchy, analysing props, and viewing needless redraws. A must have for a React developer.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/react-developer-tools-5c6e54b75a8a086d64133cd782a6aaba-ea626.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 49.860724233983284%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="react developer tools"\n        title="Example of viewing a page\'s React element hierarchy"\n        src="/static/react-developer-tools-5c6e54b75a8a086d64133cd782a6aaba-10273.png"\n        srcset="/static/react-developer-tools-5c6e54b75a8a086d64133cd782a6aaba-9b14a.png 163w,\n/static/react-developer-tools-5c6e54b75a8a086d64133cd782a6aaba-94962.png 325w,\n/static/react-developer-tools-5c6e54b75a8a086d64133cd782a6aaba-10273.png 650w,\n/static/react-developer-tools-5c6e54b75a8a086d64133cd782a6aaba-2fc6f.png 975w,\n/static/react-developer-tools-5c6e54b75a8a086d64133cd782a6aaba-a8a2c.png 1300w,\n/static/react-developer-tools-5c6e54b75a8a086d64133cd782a6aaba-173d2.png 1950w,\n/static/react-developer-tools-5c6e54b75a8a086d64133cd782a6aaba-ea626.png 2872w"\n        sizes="(max-width: 650px) 100vw, 650px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3 id="immutablejs-object-formatter"><a href="#immutablejs-object-formatter" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Immutable.JS Object Formatter</h3>\n<p><a href="https://facebook.github.io/immutable-js/">ImmutableJS</a> provides immutability within JavaScript via a simple API.</p>\n<p>Howeve, when logging these objects to the console - they are not printed in a useful way:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/immutablejs-without-formatter-467fe89481e763c069d39cd1823ef7e9-d4cc7.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 67.08701134930644%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="immutablejs without formatter"\n        title="Example of Immutable.fromJS({ a: { b: { c: [ 3, 4, 5 ] } } }) not being output in a human readable form"\n        src="/static/immutablejs-without-formatter-467fe89481e763c069d39cd1823ef7e9-10273.png"\n        srcset="/static/immutablejs-without-formatter-467fe89481e763c069d39cd1823ef7e9-9b14a.png 163w,\n/static/immutablejs-without-formatter-467fe89481e763c069d39cd1823ef7e9-94962.png 325w,\n/static/immutablejs-without-formatter-467fe89481e763c069d39cd1823ef7e9-10273.png 650w,\n/static/immutablejs-without-formatter-467fe89481e763c069d39cd1823ef7e9-2fc6f.png 975w,\n/static/immutablejs-without-formatter-467fe89481e763c069d39cd1823ef7e9-a8a2c.png 1300w,\n/static/immutablejs-without-formatter-467fe89481e763c069d39cd1823ef7e9-d4cc7.png 1586w"\n        sizes="(max-width: 650px) 100vw, 650px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>After installing the <a href="https://chrome.google.com/webstore/detail/immutablejs-object-format/hgldghadipiblonfkkicmgcbbijnpeog?hl=en">Immutable.JS Object Formatter</a>:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/immutablejs-with-formatter-220d43f69cb1b977966aac7e31472c01-d4cc7.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 67.08701134930644%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="immutablejs with formatter"\n        title="Example of Immutable.fromJS({ a: { b: { c: [ 3, 4, 5 ] } } }) not being output in a human readable form"\n        src="/static/immutablejs-with-formatter-220d43f69cb1b977966aac7e31472c01-10273.png"\n        srcset="/static/immutablejs-with-formatter-220d43f69cb1b977966aac7e31472c01-9b14a.png 163w,\n/static/immutablejs-with-formatter-220d43f69cb1b977966aac7e31472c01-94962.png 325w,\n/static/immutablejs-with-formatter-220d43f69cb1b977966aac7e31472c01-10273.png 650w,\n/static/immutablejs-with-formatter-220d43f69cb1b977966aac7e31472c01-2fc6f.png 975w,\n/static/immutablejs-with-formatter-220d43f69cb1b977966aac7e31472c01-a8a2c.png 1300w,\n/static/immutablejs-with-formatter-220d43f69cb1b977966aac7e31472c01-d4cc7.png 1586w"\n        sizes="(max-width: 650px) 100vw, 650px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3 id="json-formatter"><a href="#json-formatter" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>JSON Formatter</h3>\n<p>At the time of writing, Chrome does not support pretty printing of JSON within the browser.</p>\n<p><a href="https://chrome.google.com/webstore/detail/json-formatter/bcjindcccaagfpapjjmafapmmgkkhgoa?hl=en">JSON Formatter</a> steps in and provides this functionality.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/json-37dedf75b7a42cd44f98b4136cbf447e-95bf2.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 62.32961586121437%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="json"\n        title="Example of JSON being formatted correctly directly within the browser"\n        src="/static/json-37dedf75b7a42cd44f98b4136cbf447e-10273.png"\n        srcset="/static/json-37dedf75b7a42cd44f98b4136cbf447e-9b14a.png 163w,\n/static/json-37dedf75b7a42cd44f98b4136cbf447e-94962.png 325w,\n/static/json-37dedf75b7a42cd44f98b4136cbf447e-10273.png 650w,\n/static/json-37dedf75b7a42cd44f98b4136cbf447e-2fc6f.png 975w,\n/static/json-37dedf75b7a42cd44f98b4136cbf447e-a8a2c.png 1300w,\n/static/json-37dedf75b7a42cd44f98b4136cbf447e-95bf2.png 1614w"\n        sizes="(max-width: 650px) 100vw, 650px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3 id="post-man"><a href="#post-man" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Post Man</h3>\n<p><a href="https://www.getpostman.com/">Postman</a> is a http client with editing functionality, workspaces, mock client support, and more:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/postman-4ce491c27e5108ca993ef6eecc77e745-92a72.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 64.11764705882354%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="postman"\n        title="Example of a GET request being made to google"\n        src="/static/postman-4ce491c27e5108ca993ef6eecc77e745-10273.png"\n        srcset="/static/postman-4ce491c27e5108ca993ef6eecc77e745-9b14a.png 163w,\n/static/postman-4ce491c27e5108ca993ef6eecc77e745-94962.png 325w,\n/static/postman-4ce491c27e5108ca993ef6eecc77e745-10273.png 650w,\n/static/postman-4ce491c27e5108ca993ef6eecc77e745-2fc6f.png 975w,\n/static/postman-4ce491c27e5108ca993ef6eecc77e745-a8a2c.png 1300w,\n/static/postman-4ce491c27e5108ca993ef6eecc77e745-173d2.png 1950w,\n/static/postman-4ce491c27e5108ca993ef6eecc77e745-92a72.png 2040w"\n        sizes="(max-width: 650px) 100vw, 650px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3 id="ublock-origin"><a href="#ublock-origin" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>uBlock Origin</h3>\n<p><a href="https://chrome.google.com/webstore/detail/ublock-origin/cjpalhdlnbpafiamejdnhcphjbkeiagm?hl=en">uBlock Origin</a> A great <strong>ad blocker</strong>.</p>\n<h3 id="docker"><a href="#docker" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>docker</h3>\n<p>Docker is great for bringing up local containers, and for consistent deployments.\nFor instance it is very easy to <a href="/posts/2017-06-03-running-react-unit-tests-within-docker/">run react unit tests within docker</a>.</p>\n<h3 id="kitematic"><a href="#kitematic" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Kitematic</h3>\n<p>I am a fan of using command line tools, but sometimes a nice user interface can be appreciated.</p>\n<p>Kitematic\'s interface can search docker hub, create containers, view logs, configure network settings, and more:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/kitematic-1f2ee01ad66a0c0e29c7426c5280e122-d5fe4.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 51.83206106870229%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="kitematic"\n        title="Example of kitematic showing the currently running containers and container logs"\n        src="/static/kitematic-1f2ee01ad66a0c0e29c7426c5280e122-10273.png"\n        srcset="/static/kitematic-1f2ee01ad66a0c0e29c7426c5280e122-9b14a.png 163w,\n/static/kitematic-1f2ee01ad66a0c0e29c7426c5280e122-94962.png 325w,\n/static/kitematic-1f2ee01ad66a0c0e29c7426c5280e122-10273.png 650w,\n/static/kitematic-1f2ee01ad66a0c0e29c7426c5280e122-2fc6f.png 975w,\n/static/kitematic-1f2ee01ad66a0c0e29c7426c5280e122-a8a2c.png 1300w,\n/static/kitematic-1f2ee01ad66a0c0e29c7426c5280e122-173d2.png 1950w,\n/static/kitematic-1f2ee01ad66a0c0e29c7426c5280e122-d5fe4.png 2620w"\n        sizes="(max-width: 650px) 100vw, 650px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3 id="oh-my-zsh"><a href="#oh-my-zsh" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Oh My ZSH</h3>\n<p>Improve developer productivity by installing <a href="https://github.com/robbyrussell/oh-my-zsh">oh my zsh</a> and choosing from\nsome of the available plugins such as:</p>\n<ul>\n<li>aws</li>\n<li>docker</li>\n<li>git</li>\n<li>bundler</li>\n<li>ruby</li>\n<li>yarn</li>\n</ul>\n<h2 id="postico"><a href="#postico" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Postico</h2>\n<p><a href="https://eggerapps.at/postico/">Postico</a> is a PostSQL client for macs:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/postico-e8d2f3255cf88c95fe20c176cf25e2b9-d9c3d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 650px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 59.73360655737705%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="postico"\n        title="Example of kitematic showing the currently running containers and container logs"\n        src="/static/postico-e8d2f3255cf88c95fe20c176cf25e2b9-10273.png"\n        srcset="/static/postico-e8d2f3255cf88c95fe20c176cf25e2b9-9b14a.png 163w,\n/static/postico-e8d2f3255cf88c95fe20c176cf25e2b9-94962.png 325w,\n/static/postico-e8d2f3255cf88c95fe20c176cf25e2b9-10273.png 650w,\n/static/postico-e8d2f3255cf88c95fe20c176cf25e2b9-2fc6f.png 975w,\n/static/postico-e8d2f3255cf88c95fe20c176cf25e2b9-a8a2c.png 1300w,\n/static/postico-e8d2f3255cf88c95fe20c176cf25e2b9-173d2.png 1950w,\n/static/postico-e8d2f3255cf88c95fe20c176cf25e2b9-d9c3d.png 1952w"\n        sizes="(max-width: 650px) 100vw, 650px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2 id="colorpick-eyedropper"><a href="#colorpick-eyedropper" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>ColorPick Eyedropper</h2>\n<p>Wanting to find out the hex value of a particular color within your browser? Look no further.</p>\n<p><a href="https://chrome.google.com/webstore/detail/colorpick-eyedropper/ohcpnigalekghcmgcdcenkpelffpdolg?hl=en">ColorPick Eyedropper</a> is useful for extracting the colors directly within the browser.</p>\n<h2 id="dimensions"><a href="#dimensions" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Dimensions</h2>\n<p><a href="https://chrome.google.com/webstore/detail/dimensions/baocaagndhipibgklemoalmkljaimfdj?hl=en">Dimensions</a> can calculate the exact width/height between elements on the given web page.</p>',frontmatter:{title:"Developer tools",date:"16 April, 2018"},fields:{slug:"/posts/developer-tools/",editURL:"https:/github.com/AlanFoster/alanfoster.github.io/edit/develop/src/pages/posts/developer-tools/index.markdown"}}},pathContext:{sidebarPath:null,slug:"/posts/developer-tools/"}}}});
